// 為 {啟動時間} 增加 10 天的時間間隔。下列字段 {啟動時間} 是日期類型且單元格值 2021/03/25 。計時單位 "days" 表示按 “天” 計算。
公式：DATEADD({啟動時間}, 10, "days")
運算結果：2021/04/04

